import React, { useState } from 'react';
import './cashflow.css'; // This file will contain the necessary CSS
import Footer from './footer';

const CashFlow = () => {
    const [isSubmitted, setIsSubmitted] = useState(false);

    const handleSubmit = (e) => {
        e.preventDefault();
        setIsSubmitted(true);
    };

    const closePopup = () => {
        setIsSubmitted(false);
    };

    return (
        <div className="application-form-page">
            {/* Header Section */}
            <header>
                <img src="logo.png" alt="MSU-IIT NMPC Logo" className="logo" />
                <h2 className="landingh2">MSU-IIT National Multi-Purpose Cooperative</h2>
                <nav>
                    <a href="/login" className="nav-link">Login</a>
                    <a href="/register" className="nav-link">Register</a>
                </nav>
            </header>

            {/* Form Container */}
            <div className="form-container">
                <h3 className="title">Cash Flow Statement</h3>
                <form className="cashflow-form" onSubmit={handleSubmit}>
                    <div className="section">
                        <div className="item">
                            <label>Salaries and Wages:</label>
                            <input type="number" placeholder="₱" />
                        </div>
                        <div className="item">
                            <label>Spouse Income:</label>
                            <input type="number" placeholder="₱" />
                        </div>
                        <div className="item">
                            <label>Income from Business (Net):</label>
                            <input type="number" placeholder="₱" />
                        </div>
                        <div className="item">
                            <label>Income from Financial Investment/Dividend:</label>
                            <input type="number" placeholder="₱" />
                        </div>
                        <div className="item">
                            <label>Other Income:</label>
                            <input type="number" placeholder="₱" />
                        </div>
                        <div className="item">
                            <label style={{ fontWeight: "bold" }}>TOTAL INCOME</label>
                            <input type="number" placeholder="₱" />
                        </div>
                    </div>

                    <div className="section">
                        <h3>Expenditures</h3>
                        {/* Other fields for expenditures */}
                    </div>

                    <br></br>
                    <p className="aboutp">
                        I certify to the correctness and truthfulness of the above statements according to my knowledge and belief. 
                        Any false declaration made by me which may be 
                        found later shall cause the disapproval of my loan application.
                    </p>
                    <br></br>
                    <div className="form-row-5">
                        {/* Other form fields */}
                    </div>

                    <button type="submit" className="submit-btn-1">Submit</button>
                </form>
                <br></br>
            </div>

            {/* Popup Modal */}
            {isSubmitted && (
                <div className="popup-modal">
                    <div className="popup-content">
                        <h2>You've submitted your application.</h2>
                        <p>You will be notified once your application has been approved. Thank you.</p>
                        <button onClick={closePopup} className="close-btn">Close</button>
                    </div>
                </div>
            )}

            < Footer />
        </div>
    );
};

export default CashFlow;
